import React from 'react';
import './About.css';
const About=()=>{
return(
    <React.Fragment>
  <header class="masthead">
    <div class="container h-100">
      <div class="row h-100 align-items-center justify-content-center text-center">
        <div class="col-lg-10 align-self-end">
          <h1 class="text-uppercase text-white font-weight-bold">Support the community by offering voluntary services & support</h1>
          <hr class="divider my-4"/>
        </div>
        <div class="col-lg-8 align-self-baseline">
          <p class="text-white-75 font-weight-light mb-5">Support the community by registering for volunteer work and donate the useful items to support !!</p>
          <a style={"btn btn-primary btn-xl js-scroll-trigger"} href="#about">Find Out More</a>
        </div>
      </div>
    </div>
  </header>
  

    </React.Fragment>
)
}



export default About;
